import React, { Component } from 'react'
import { withTranslation } from "react-i18next";
import i18n from "i18next";
import Footer from '../LandingPage/Footer'
import { NavBar } from '../Legal/tremsConditionsNavbar'
import  {InvitationForm}  from './InvitationRequestForm'
  class InvitationRequest extends Component {
    componentDidMount() {
        document.body.dir = i18n.dir();
      }
    render() {
        const { t } = this.props;
        const language = localStorage.getItem("i18nextLng");
        return (
            <div>
                <NavBar
                style={{margin:"0"}}
                title={t("notInvited:notInvitedNavbarTitle")} 
                subtitle={t("notInvited:notInvitedNavbarSubTitle")}/>
                <InvitationForm/>
                <Footer/>
            </div>
        )
    }
}
 export default withTranslation("notInvited")(InvitationRequest);
